import React from "react";


function Story() {
 
        return (
            <section className="sec_2"  id="scrollspyHeading3">
                <div className="scene">
                    <div className="scene_bg"></div>
                    <div className="scene_text">태초부터 존재했던 거대한 뱀이
                        어느 날 고개를 들고 태양에게 물었습니다.
                    </div>
                </div>
               
		</section>
        )
    
}

export default Story;
